import React, { useState, useEffect } from 'react';
import Navbar from '../Components/nav-admin';

function UserTable() {
    const [users, setUsers] = useState([]);
    const [editFormData, setEditFormData] = useState(null);  // Holds the data of the user being edited

    useEffect(() => {
        fetchUsers();
    }, []);

    const fetchUsers = () => {
        // Existing fetch code
    };

    // Open modal with user data
    const openEditModal = (user) => {
        setEditFormData(user);
    };

    // Close modal
    const closeEditModal = () => {
        setEditFormData(null);
    };

    // Handle form changes
    const handleEditFormChange = (event) => {
        const { name, value } = event.target;
        setEditFormData(prevData => ({
            ...prevData,
            [name]: value,
        }));
    };

    // Submit edit form
    const submitEditForm = () => {
        fetch(`http://localhost:3002/Doctors/update/${editFormData._id}`, {
            method: 'PATCH',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify(editFormData),
        })
        .then(response => response.json())
        .then(() => {
            alert('User updated successfully');
            fetchUsers();
            closeEditModal();
        })
        .catch(error => {
            console.error('Error updating user:', error);
            alert('Failed to update user.');
        });
    };

    return (
        <div className="user-management-container">
            <Navbar />
            {editFormData && (
                <div className="edit-modal">
                    <form onSubmit={e => { e.preventDefault(); submitEditForm(); }}>
                        <label>Name</label>
                        <input
                            type="text"
                            name="userName"
                            value={editFormData.userName}
                            onChange={handleEditFormChange}
                        />
                        {/* Add more fields as necessary */}
                        <button type="submit">Save Changes</button>
                        <button onClick={closeEditModal}>Cancel</button>
                    </form>
                </div>
            )}
            <div className="user-table-container">
                <table className="user-table">
                    <thead>
                        <tr>
                        <th>Name</th>
                             <th>Email</th>
                             <th>Role</th>
                             <th>Registered ID</th>
                             <th>Working Hospitals</th>
                             <th>Age</th>
                             <th>Contact No</th>
                             <th>Bio</th>
                             <th>Profile Image</th>
                             <th>Signature Image</th>
                             <th>Actions</th>
                             <th>Verification</th>                        
                    </tr>
                    </thead>
                    <tbody>
                        {users.map(user => (
                            <tr key={user._id}>
                                {/* User data and other buttons */}
                                <td>
                                    <button onClick={() => openEditModal(user)}>Edit</button>
                                    <button onClick={() => deleteUser(user._id)}>Delete</button>
                                </td>
                                {/* More user data cells */}
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
}

export default UserTable;
